@Sango_ (Kai Wright) didn’t expect to build a career as a musician. Growing up in Grand Rapids, Michigan, Kai made flyers for high school parties and worked on murals around town, so graphic design seemed like an obvious path when he started at @WesternMichU. But his passion for music grew from a casual hobby into career, and rather than heading for design school, he went on tour. Now, with more than 20 records and countless productions for other artists to his name, Kai has been reflecting on the crossover of his two passions. “I always thought music would be my hobby, but now design is,” he said. “It’s an extra part of my artistry.” 🎹🖊

